import callapi from "../Common/apicall.js";
export default {
    name: "MyPlan",
    data: function () {
        return {
            formstate: {},
            model: {
                FutureSavingAmount: 500000,
                NYear: 5,
                FirstSavingAmount: 0,
                CompensationRate: 0.5,
                SavingIncRate: 0
            },
            result: {
                FutureValue: 0,
                SavingMonth: 0
            }
        }
    },
    mounted() { },
    methods: {
        twoDigit: function (val) {
            try {
                return val.toFixed(2).toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",")
            } catch{
                return ''
            }
        },
        fieldClassName: function (field) {
            if (!field) {
                return "";
            }
            if ((field.$touched || field.$submitted) && field.$valid) {
                return "has-success";
            }
            if ((field.$touched || field.$submitted) && field.$invalid) {
                return "has-danger";
            }
        },
        onSubmit: function () {
            $('#result').fadeOut(200);
            if (this.formstate.$invalid) {
                return;
            }
            var response = callapi.post(Server + EndPoint, Target, this.model, ocpkey).then(response => {
                this.result.FutureValue = response.data.FutureValue;
                this.result.SavingMonth = response.data.SavingMonth;
                $('#result').fadeIn(400);
            }).catch(e => {
                this.errors.push(e);
            })
        }
    }
};
